import React, { useEffect, useState } from "react";
import axios from "axios";
import { MapPinIcon } from "@heroicons/react/24/outline";
import { useNavigate } from "react-router-dom";

export default function ReportedIncidents() {
  const [reports, setReports] = useState([]);
  const [filter, setFilter] = useState("");
  const [isLoading, setIsLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchReports = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/crime");
        setReports(res.data);
      } catch (error) {
        console.error("Error fetching reports:", error);
      } finally {
        setIsLoading(false);
      }
    };
    fetchReports();
  }, []);

  const filteredReports = filter
    ? reports.filter((r) => r.crimeType === filter)
    : reports;

  if (isLoading) {
    return (
      <div className="w-screen h-screen flex items-center justify-center bg-gradient-to-br from-indigo-900 via-purple-800 to-pink-700">
        <div className="bg-white/10 backdrop-blur-sm p-8 rounded-lg flex flex-col items-center">
          <div className="w-16 h-16 border-4 border-white border-t-transparent rounded-full animate-spin mb-4"></div>
          <p className="text-white text-lg">Loading incidents...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="w-screen h-screen bg-gradient-to-br from-indigo-900 via-purple-800 to-pink-700 flex items-center justify-center">
      <div className="w-full max-w-4xl mx-auto">
        <div className="bg-white/30 backdrop-blur-sm rounded-xl shadow-xl">
          <div className="flex items-center justify-between px-6 py-4 border-b border-white/20">
            <div className="flex items-center gap-2">
              <h2 className="text-xl font-semibold text-white flex items-center gap-2">
                <MapPinIcon className="h-5 w-5 text-white" /> Reported Incidents
              </h2>
            </div>
            <div className="flex items-center gap-4">
              <button
                onClick={() => navigate('/report')}
                className="flex items-center px-4 py-2 bg-white text-indigo-900 rounded-lg text-sm font-medium hover:bg-white/90 transition-colors duration-200"
              >
                <MapPinIcon className="h-4 w-4 mr-1" />
                Report New Incident
              </button>
              <select
                value={filter}
                onChange={(e) => setFilter(e.target.value)}
                className="bg-white/30 border border-white/30 text-white px-3 py-1 rounded-lg text-sm focus:ring-2 focus:ring-white/50 focus:border-transparent outline-none"
              >
                <option value="">All Types</option>
                <option value="Theft">Theft</option>
                <option value="Assault">Assault</option>
                <option value="Burglary">Burglary</option>
                <option value="Vandalism">Vandalism</option>
                <option value="Fraud">Fraud</option>
                <option value="Other">Other</option>
              </select>
            </div>
          </div>
          
          <div className="p-6 grid gap-4 max-h-[70vh] overflow-y-auto">
            {filteredReports.map((report) => (
              <div 
                key={report.id} 
                className="bg-white/20 backdrop-blur-sm rounded-lg p-4 hover:bg-white/30 transition-all duration-300 border border-white/20"
              >
                <div className="flex items-start justify-between">
                  <div>
                    <span className={`inline-block px-2 py-1 rounded-full text-xs font-bold mb-2 ${
                      report.crimeType === "Theft"
                        ? "bg-yellow-200/90 text-yellow-900"
                        : report.crimeType === "Assault"
                        ? "bg-red-200/90 text-red-900"
                        : report.crimeType === "Burglary"
                        ? "bg-pink-200/90 text-pink-900"
                        : report.crimeType === "Vandalism"
                        ? "bg-blue-200/90 text-blue-900"
                        : report.crimeType === "Fraud"
                        ? "bg-green-200/90 text-green-900"
                        : "bg-gray-200/90 text-gray-900"
                    }`}>
                      {report.crimeType}
                    </span>
                    <p className="text-white font-medium mb-2">{report.description}</p>
                  </div>
                  <span className="text-xs text-white/80">
                    {new Date(report.timestamp).toLocaleString()}
                  </span>
                </div>
                <div className="flex items-center gap-2 text-xs text-white/80">
                  <MapPinIcon className="h-4 w-4" />
                  <span>Lat: {report.latitude.toFixed(4)}, Long: {report.longitude.toFixed(4)}</span>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}
